import { observer } from 'mobx-react';
import React from 'react'
import { View, Text } from 'react-native'

const RequestItem = ({request , navigation}) => {
    return (
        <View>
            <Text>{request.name}</Text>
        </View>
    )
}

export default observer(RequestItem);
